import React from 'react';
import './Actu.css';
import Nav from './BandeauHaut';
import Match from './Match';

import {Row} from 'react-bootstrap';
import {Container} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import EquipeClassement from './EquipeClassement';

export default class Actu extends React.Component {
    
    render() {
        let matchs= [{
            ville1 : 'Los Angeles',
            equipe1 : 'Lakers',
            score1 : 97,
            ville2 : 'New York',
            equipe2 : 'Knicks',
            score2 : 112
        },
        {
            ville1 : 'Miami',
            equipe1 : 'Heat',
            score1 : 125,
            ville2 : 'Orlando',
            equipe2 : 'Magic',
            score2 : 117
        },
        {
            ville1 : 'Brooklyn',
            equipe1 : 'Net',
            score1 : 108,
            ville2 : 'Detroit',
            equipe2 : 'Pistons',
            score2 : 84
        },
        {
            ville1 : 'Sacramento',
            equipe1 : 'Kings',
            score1 : 106,
            ville2 : 'Phoenix',
            equipe2 : 'Suns',
            score2 : 108
        },
        ];

        let Classement = [{
